import Vue from 'vue'
import VueRouter from 'vue-router'
import Posts from './views/PostsData'

Vue.use(VueRouter)

export default new VueRouter({
    mode: 'history',
    base: process.env.BASE_URL,
    routes: [
        {
            path: '/posts',
            name: 'posts',
            component: Posts,
        },
    ]
})
